import React, { useState, useEffect } from "react";
import CustomDropdown from "../../../components/CustomDropdown";
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";
import PDFUploaderViewer from "../../../components/PDFUploaderViewer"; // Import the PDF uploader/viewer component

const RecordsModal = ({ isOpen, onClose, onSave, data, options }) => {
  const [formData, setFormData] = useState({
    name: "",
    department: null,
    trainingTypeResponse: null,
    status: null,
    startTime: "",
    endTime: "",
    isOnline: null,
    meetingLink: "",
    instructors: [],
    attendees: [],
    pdfFiles: [], // Add a new field for PDF files
    fileName: "",
  });

  useEffect(() => {
    if (isOpen && data) {
      setFormData({
        fileName: "deneme",
        name: data.name || "",
        department: data.department || null,
        trainingTypeResponse: data.trainingTypeResponse || null,
        status: data.status || null,
        startTime: data.startTime || "",
        endTime: data.endTime || "",
        isOnline: data.isOnline || null,
        meetingLink: data.meetingLink || "",
        instructors: data.instructors || [],
        attendees: data.attendees || [],
        pdfFiles: data.pdfFiles || [
          "data:application/pdf;base64,",
        ], // Load existing PDF files
      });
    }
    if (isOpen && !data) {
      setFormData({
        name: "",
        department: null,
        trainingTypeResponse: null,
        status: null,
        startTime: "",
        endTime: "",
        isOnline: null,
        meetingLink: "",
        instructors: [],
        attendees: [],
        pdfFiles: [], // Initialize PDF files array
      });
    }
  }, [data, isOpen]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  const handlePDFUpload = (fileContent) => {
    setFormData((prevData) => ({
      ...prevData,
      pdfFiles: [fileContent],
    }));
  };

  const handlePDFDelete = () => {
    setFormData((prevData) => ({
      ...prevData,
      pdfFiles: [],
    }));
  };

  const handleSave = () => {
    const newRecord = {
      ...data,
      ...formData,
    };
    onSave(newRecord);
  };

  if (!isOpen) return null;

  return (
    <div className="fixed inset-0 bg-gray-600 bg-opacity-50 flex justify-center items-center z-50 rounded-lg">
      <div className="bg-gray-200 rounded shadow-lg p-8 w-1/4 h-3/4 overflow-y-scroll">
        <div className="space-y-4">
          <div>
            <label className="block text-gray-700 font-bold">Record Name</label>
            <input
              type="text"
              name="name"
              className="w-full border border-gray-300 p-2 rounded"
              value={formData.name}
              onChange={handleChange}
            />
          </div>
          <div>
            <label className="block text-gray-700 font-bold">
              Department Name
            </label>
            <CustomDropdown
              title={"department name"}
              options={options.companies}
              selectedValue={formData.department?.id}
              onChange={(value) => {
                setFormData((prevData) => ({
                  ...prevData,
                  department: value,
                }));
              }}
            />
          </div>
          <div>
            <label className="block text-gray-700 font-bold">
              Training Type
            </label>
            <CustomDropdown
              title={"training type"}
              options={options.companies}
              selectedValue={formData.trainingTypeResponse?.id}
              onChange={(value) => {
                setFormData((prevData) => ({
                  ...prevData,
                  trainingTypeResponse: value,
                }));
              }}
            />
          </div>
          <div>
            <label className="block text-gray-700 font-bold">Status</label>
            <input
              type="text"
              name="status"
              className="w-full border border-gray-300 p-2 rounded"
              value={formData.status}
              onChange={handleChange}
            />
          </div>
          <div>
            <label className="block text-gray-700 font-bold">Start Time</label>
            <DatePicker
              selected={formData.startTime}
              onChange={(date) =>
                setFormData((prevData) => ({
                  ...prevData,
                  startTime: date,
                }))
              }
              dateFormat="dd/MM/yyyy"
              className="w-full border border-gray-300 p-2 rounded"
            />
          </div>
          <div>
            <label className="block text-gray-700 font-bold">End Time</label>
            <DatePicker
              selected={formData.endTime}
              onChange={(date) =>
                setFormData((prevData) => ({
                  ...prevData,
                  endTime: date,
                }))
              }
              dateFormat="dd/MM/yyyy"
              className="w-full border border-gray-300 p-2 rounded"
            />
          </div>
          <div>
            <label className="block text-gray-700 font-bold">Channel</label>
            <CustomDropdown
              title={"training type"}
              options={options.companies}
              selectedValue={formData.isOnline}
              onChange={(value) => {
                setFormData((prevData) => ({
                  ...prevData,
                  isOnline: value,
                }));
              }}
            />
          </div>
          <div>
            <label className="block text-gray-700 font-bold">
              Meeting Link
            </label>
            <input
              type="text"
              name="meetingLink"
              className="w-full border border-gray-300 p-2 rounded"
              value={formData.meetingLink}
              onChange={handleChange}
            />
          </div>
          <div>
            <label className="block text-gray-700 font-bold">Instructors</label>
            <CustomDropdown
              title={"instructors"}
              isMultiple={true}
              options={options.companies}
              selectedValue={formData.instructors}
              onChange={(value) => {
                setFormData((prevData) => ({
                  ...prevData,
                  instructors: value,
                }));
              }}
            />
          </div>
          <div>
            <label className="block text-gray-700 font-bold">Attendees</label>
            <CustomDropdown
              title={"attendees"}
              isMultiple={true}
              options={options.companies}
              selectedValue={formData.attendees}
              onChange={(value) => {
                setFormData((prevData) => ({
                  ...prevData,
                  attendees: value,
                }));
              }}
            />
          </div>
          <div>
            <label className="block text-gray-700 font-bold">Upload PDF</label>
            <PDFUploaderViewer
              base64Files={formData.pdfFiles}
              fileName={formData.fileName}
              onUpload={handlePDFUpload}
              onDelete={handlePDFDelete}
            />
          </div>
        </div>
        <div className="flex justify-end mt-6 w-full">
          <button
            className="bg-signupButtonStrokeColor text-white px-4 py-2 rounded mr-2 w-1/2"
            onClick={onClose}
          >
            Cancel
          </button>
          <button
            className={`${
              data?.id ? "bg-updateButton" : "bg-createButtons"
            } text-white px-4 py-2 rounded w-1/2`}
            onClick={handleSave}
          >
            {data?.id ? "Update" : "Submit"}
          </button>
        </div>
      </div>
    </div>
  );
};

export default RecordsModal;
